import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import { Button } from "react-bootstrap";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";

const RolesPage = () => {
  const navigate = useNavigate();
  const [listData, setListData] = useState([]);

  // Fetch the list of user roles
  useEffect(() => {
    getUserRoles();
  }, []);

  const getUserRoles = async () => {
    try {
      const response = await axios.get(
        "http://localhost:8080/auth/list-userrole"
      );
      console.log("Fetched data:", response?.data?.data);
      setListData(response?.data?.data || []);
    } catch (error) {
      console.error("Error fetching user roles:", error);
    }
  };

  return (
    <Box>
      <Link to="/add-user-role" className="agency-add btn next-btn">
        Add UserRole
      </Link>
      <TableContainer component={Paper} id="document-table">
        <Table aria-label="User Roles Table" className="all-round-borders">
          <TableHead>
            <TableRow>
              <TableCell className="tableborder table-head-cell">
                Sr. No.
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Name
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Mobile
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="left">
                Email
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="center">
                Role
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="center">
                Status
              </TableCell>
              <TableCell className="tableborder table-head-cell" align="center">
                Action
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {listData.length > 0 ? (
              listData.map((item, index) => (
                <TableRow key={item._id || index}>
                  <TableCell className="text-start tableborder">
                    {index + 1}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.name || "N/A"}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.mobile || "N/A"}
                  </TableCell>
                  <TableCell align="left" className="tableborder">
                    {item.email || "N/A"}
                  </TableCell>
                  <TableCell align="center" className="tableborder">
                    {item.role || "N/A"}
                  </TableCell>
                  <TableCell align="center" className="tableborder">
                    {item.isActive ? "Active" : "Inactive"}
                  </TableCell>
                  <td className="actions">
                    <Link to={`/editrole/${item._id}`}>
                      <Button variant="primary" className="edit-btn">
                        Edit
                      </Button>
                    </Link>
                    <Button
                      variant="danger"
                      className="delete-btn"
                      onClick={() => {
                        // Add delete functionality here
                        alert(`Delete role with ID: ${item._id}`);
                      }}
                    >
                      Delete
                    </Button>
                  </td>
                </TableRow>
              ))
            ) : (
              <TableRow>
                <TableCell colSpan={7} align="center">
                  No data available.
                </TableCell>
              </TableRow>
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </Box>
  );
};

export default RolesPage;
